

CREATE TABLE `_orders` (
  `id` int(11) NOT NULL COMMENT 'Идентификатор заказа',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT 'Cтатус заказа',
  `client_id` int(11) NOT NULL COMMENT 'Ссылка на идентификатор клиента',
  `created_at` datetime NOT NULL COMMENT 'Дата создания заказа',
  `user_id` int(11) NOT NULL COMMENT 'Ссылка на идентификатор продавца',
  `payment` int(11) NOT NULL,
  `amount` int(11) NOT NULL,
  `discount` int(11) DEFAULT '0',
  `delivery_id` int(11) DEFAULT NULL,
  `discription` longtext,
  `delivery_date` varchar(45) DEFAULT NULL,
  `delivery_time_in` varchar(45) DEFAULT NULL,
  `delivery_time_out` varchar(45) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `stations` varchar(255) DEFAULT NULL,
  `discounts` mediumtext,
  `payments` mediumtext
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Справочник заказов';


